import React from "react";
import Test from "./Test";
import { Select } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormHelperText from '@material-ui/core/FormHelperText';
import FormControl from '@material-ui/core/FormControl';


import {
  MDBDropdown,
  MDBDropdownToggle,
  MDBBtn,
  MDBBtnGroup,
  MDBDropdownMenu,
  MDBDropdownItem,
} from "mdbreact";

function Header({ title }) {
  return (
    <div>
      <h4>{title} </h4>
    </div>
  );
}
function Dropdown({ name, d1, d2, d3 }) {
  return (
    <MDBDropdown>
      <MDBDropdownToggle caret color="primary">
        {name}
      </MDBDropdownToggle>
      <MDBDropdownMenu basic>
        <MDBDropdownItem>{d1}</MDBDropdownItem>
        <MDBDropdownItem>{d2}</MDBDropdownItem>
        <MDBDropdownItem>{d3}</MDBDropdownItem>
      </MDBDropdownMenu>
    </MDBDropdown>
  );
}

function Image({ name, title, src }) {
  const size = {
    width: "50%",
  };
  return (
    <div className="text-center">
      <img
        style={size}
        src={src}
        alt="avatar mx-auto white"
        className="rounded-circle img-fluid"
      />
      <br />
    </div>
  );
}

function Leadership() {
	return (
		<div> 
		<Header title="Leadership" />
		<br />
		<div className="row">
		  <div className="col">
			<Image src="https://mdbootstrap.com/img/Photos/Avatars/img%20(27).jpg" />
		  </div>
